    data: |
      SELECT + col0 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - + col1 BETWEEN - col1 * + - 26 + - 64 - - col2 / - col2 AND - + col0;
  - name: tab0

outputs:
  - name: q2294.out
    data: |
      15
      87
      97
